function loadNanexImageData(scene) {

    for (var i =0; i < nanex_image_list.length; i ++) {
        var circle_loc = (i+2)*2.0*3.14159/12;

        var entry = "./videos/"+ nanex_image_list[i];

        var element = document.createElement( 'div' );
        element.style.width  = 640 + 'px';
        element.style.height = 480 + 'px';
        element.style.zIndex = 50;

        var object = new THREE.CSS3DObject( element );

        // Eric - video placement
        object.position.x = Math.cos(circle_loc) * 800;
        object.position.y = Math.sin(circle_loc) * 600 - 100;
        object.position.z = 1500 + i*-2500/nanex_image_list.length;// Math.random() * -4000;

/*      object.position.x = Math.random() * 4000 - 2000;
        object.position.y = Math.random() * 2000 - 1000;
        object.position.z = Math.random() * - 5000;
  */
        scene.add( object );

        var properties = { data: entry,  object: object }
        element.properties = properties;

        var video = document.createElement( 'video' );

        if(typeof video.loop == 'boolean'){
            video.loop = true;
        }

        video.style.position = 'absolute';
        video.style.width = video_width + 'px';
        video.style.height = video_height + 'px';
        //video.style.opacity = 0.0;
        element.appendChild( video );

        var source = document.createElement("source");
        source.src = entry;
        source.type = "video/mp4";
        video.appendChild(source);
        video.play();

        nanex_image_objs.push( [object, video, 0.0] );
    }


    // hide them all for now
    for ( var i = 0; i < nanex_image_objs.length; i ++ ) {
        var new_obj = nanex_image_objs[i][0];
        $(new_obj.element).css({opacity: 0.0});
    }

   // auto = true;
}

