function loadNanexNewsData(first_time) {
    var file_name = article_list[news_index];

    var entry = "./articles/" +file_name ;

    var element = document.createElement( 'div' );
    element.style.width = img_width + 'px';
    element.style.height = img_height + 'px';
    element.style.zIndex = 100

    var object = new THREE.CSS3DObject( element );
    object.position.x = Math.random() * 4000 - 2000;
    object.position.y = Math.random() * 2000 - 1000;
    object.position.z = Math.random() * - 5000;

    var properties = { data: entry,  object: object }
    element.properties = properties;

    var image = document.createElement( 'img' );
    image.addEventListener( 'load', function ( event ) {
        var sec_timeout = 2;
        new TWEEN.Tween( object.position )
            .to( {
                y: 0,
                z: 1000,
                x: 0
            }, sec_timeout * 450 )
            .easing( TWEEN.Easing.Exponential.Out).onComplete(function() {
                if(auto) {
                    setTimeout(function() {
                        new TWEEN.Tween( object.position )
                            .to( {
                                y:  Math.random() * 500 -1000,
                                z: 2500,
                                x: Math.random() * 1000 - 500
                            }, sec_timeout/2 * 450).easing(TWEEN.Easing.Exponential.In)
                            .start()

                        // fetch the new news!
                        news_index++;

                        loadNanexNewsData(false)
                    }, article_delay[news_index]  * 800)
                }
            }).start();

    }, false );
    image.style.position = 'absolute';
    image.style.width = img_width + 'px';
    image.style.height = img_height + 'px';
    image.src = entry;
    element.appendChild( image );

    scene.add( object );

    nanex_news_objs.push( object );
}

