//start showing date, use date_index to keep place
function showDates() {
    date_index++;

    // when we get to the end, stop the dates, stop the timer and stop the animation
    if (date_index > dates.length-2) {

        // stop timer
        clearInterval(date_interval);

        // clear the date field
        stopDates();
    } else {
        var date_split = dates[date_index].split(" ");
        // Output the day, date, month and year
        $('#Date').html(date_split[0] + ' ' + date_split[1] + ' ' + date_split[2]);
        $('#Totals').html(totals[date_index])
        $('#rotm').attr("src", "./rise_of_the_machines/" + rotm_dates[date_index] + ".HiQteSymbols.1m.1s.08_34.sum.gif");
    }
}

